import React from 'react';
import './App.css';
import Crossword from '@jaredreisinger/react-crossword';

const data = {
  across: {
    1: {
      clue: 'one plus one',
      answer: 'TWO',
      row: 0,
      col: 0,
    },
  },
  down: {
    2: {
      clue: 'three minus two',
      answer: 'ONE',
      row: 0,
      col: 2,
    },
  },
};


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Crossword data={data} />
      </header>
    </div>
  );
}

export default App;
